import React from "react";
import Header from "./Header";
import Parallax from "./Parallax";

class LandingPage extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="landing-page-container">
        <Header />
        <div>
          <Parallax />
        </div>
      </div>
    );
  }
}

